import React from 'react';
import logo from './logo.svg';
import './App.css';
import Navbar from './Modules/Layout/Component/Navbar';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Home from './Modules/Layout/Component/Home';

function App() {
  return (
    <>
      <div className="grid">
        <BrowserRouter>
          <Routes>
            <Route path='/' element={<Home/>}/>
            <Route path='/' element={<Home/>}/>
            <Route path='/' element={<Home/>}/>
            <Route path='/' element={<Home/>}/>

          </Routes>
        </BrowserRouter>
          <Navbar/>

      </div>
    </>
  );
}

export default App;
